INSERT INTO `books` (`id`, `title`, `author`, `description`, `cover_photo`, `viewed`, `download_url`, `created_by`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 'Php, Mysql, Javascript & Html5 All-In-One For Dummies', 'Steve Suehring, Janet Valade', 'Get the basics on four key web programming tools in one great book!\r\n\r\nPHP, JavaScript, and HTML5 are essential programming languages for creating dynamic websites that work with the MySQL database. PHP and MySQL provide a robust, easy-to-learn, open-source solution for creating superb e-commerce sites and content management. JavaScript and HTML5 add support for the most current multimedia effects. This one-stop guide gives you what you need to know about all four! Seven self-contained minibooks cover web technologies, HTML5 and CSS3, PHP programming, MySQL databases, JavaScript, PHP with templates, and web applications.\r\n\r\nAddresses how PHP, MySQL, JavaScript, and HTML5 are vital tools for creating dynamic, database-driven websites and are especially important for e-commerce sites\r\nServes as essential reading for web designers who are new to these technologies, offering a crash course covering all of these powerful technologies in this handy volume of seven self-contained minibooks\r\nCovers how to program in PHP and how to create and administer a MySQL database as well as how to manipulate MySQL data via a web interface\r\nShows how to create a secure website and how to code popular e-business applications such as login programs and shopping carts\r\nWith seven books in one, PHP, MySQL, JavaScript & HTML5 All-in-One For Dummies will turn your website into the center of attention in no time at all.', , 3, 'http://sachvui.com/download/pdf/4589', 2, NULL, '2018-04-01 12:34:52', '2018-04-01 13:33:03');
INSERT INTO `books` (`id`, `title`, `author`, `description`, `cover_photo`, `viewed`, `download_url`, `created_by`, `deleted_at`, `created_at`, `updated_at`) VALUES
(2, 'Giải Thuật Và Lập Trình', 'Lê Minh Hoàng', 'Nếu bạn là người đam mê tin học, nếu bạn là người muốn khám phá về lập trình, hẳn bạn phải biết đến một cuốn sách tin học rất nổi tiếng ở Việt Nam trong nhiều năm trở lại đây. Từ những học sinh không chuyên đến những thành viên đội tuyển thi quốc tế tin học, có lẽ không một ai chưa từng học qua cuốn sách được biên soạn bởi một thầy giáo trẻ những đầy tài năng của trường Đại học Sư phạm Hà Nội, thầy Lê Minh Hoàng.', , 0, 'http://sachvui.com/download/pdf/4591', 2, NULL, '2018-04-01 13:07:35', '2018-04-01 13:07:35');
INSERT INTO `books` (`id`, `title`, `author`, `description`, `cover_photo`, `viewed`, `download_url`, `created_by`, `deleted_at`, `created_at`, `updated_at`) VALUES
(3, '10 Lời Khuyên Khởi Nghiệp', 'Caspian Woods', 'Trong những năm qua, tôi được gặp khá nhiều chủ doanh nghiệp trẻ. Hầu hết đều chia sẻ với tôi những khó khăn giống nhau. Rất nhiều người cảm thấy mệt mỏi và dường như có chung tâm trạng “Ước gì mình tìm được người quản lý giỏi”; “Ước gì mình được khởi sự lại để không va vấp”...\r\n\r\nTrong những cuộc trò chuyện này, tôi rất ngạc nhiên là nhiều chủ doanh nghiệp khi thành lập công ty hầu như chưa chuẩn bị cho mình đủ kiến thức khởi nghiệp, họ không biết mình phải làm gì, không có kế hoạch hành động, không biết các kỹ năng cần thiết để quản lý, nhân sự, tổ chức. Đó là lý do đa phần các doanh nghiệp nhỏ và vừa của Việt Nam đều yếu và không có nền tảng vững chắc. Đó cũng là lý do mà tỷ lệ doanh nghiệp Việt Nam vững mạnh rất thấp. Hiện nay, theo số liệu thống kê, Việt Nam có khoảng 340.000 doanh nghiệp vừa và nhỏ với khoảng 50.000 doanh nghiệp mới được thành lập hàng năm. Nhưng tôi tin rằng chỉ một số ít trong đó được xây dựng và phát triển trên nền tảng thật sự. Do không có nền móng vững chắc ngay từ đầu nên việc phát triển tiếp và đưa doanh nghiệp lớn mạnh hơn, đi xa hơn là rất khó khăn. Ngay bản thân chúng tôi, những người sáng lập Alpha Books cũng vấp phải tình trạng này khi lập nghiệp.\r\n\r\nỞ Việt Nam, mặc dù tỷ lệ các công ty phá sản thấp nhưng lại hoạt động cầm chừng, nhiều doanh nghiệp không nhìn thấy lối thoát cho mình. Họ sa lầy trong bài toán tiến thoái lưỡng nan, phát triển tiếp không được mà đóng cửa cũng không xong. Nhiều bạn trẻ đã không chú tâm đúng mức cho việc nghiên cứu và chuẩn bị kiến thức khởi sự doanh nghiệp. Họ không tìm kiếm lời khuyên và kinh nghiệm từ những người đi trước, không đọc sách và tìm hiểu bài học thực tiễn từ các công ty đã và đang phát triển, trong khi, đó là cách học rất nhanh, đơn giản và tiết kiệm.\r\n\r\nĐó chính là lý do Alpha Books lựa chọn và xuất bản hàng loạt cuốn sách về khởi thuật, về nghệ thuật khởi nghiệp nhằm cung cấp cho các bạn trẻ những kiến thức, kỹ năng, kinh nghiệm thành lập và phát triển doanh nghiệp. Trong hai năm qua, Alpha Books đã xuất bản các cuốn sách về chủ đề này như Khởi thuật của Kawasaki; Những người khổng lồ bé nhỏ của Bo Burlingham, và lần này, với cuốn Từ những hạt sồi… của Caspian Woods, một trong những nhà tư vấn xuất sắc của Anh.\r\n\r\nKhi mới khởi nghiệp, bạn thường cảm thấy mình chỉ như một hạt sồi, còi cọc nhỏ bé dưới cái bóng khổng lồ của những cây sồi trưởng thành xung quanh. Nhưng bạn cần biết rằng, những công ty hàng đầu thế giới đã bắt đầu từ phòng ngủ, những quầy hàng trong chợ hay trên xe tải. Hàng triệu người ngày ngày đang lặng lẽ theo đuổi giấc mơ của mình mới chính là những câu chuyện về thành công bạn cần học hỏi.\r\n\r\nNhư tạp chí Esquire của Anh nhận xét, đây là “cuốn sách phù hợp nhất cho ai muốn khởi nghiệp”, chúng tôi hy vọng các bạn đang khao khát khởi sự doanh nghiệp yêu thích cuốn sách này và thấy nó thật hữu ích. Chúng tôi cũng rất mong nhận được những phản hồi, bí quyết và ý kiến của các bạn để có thể chia sẻ lại với các doanh nhân trẻ khác.', , 2, 'http://sachvui.com/download/epub/4782', 2, NULL, '2018-04-01 13:09:51', '2018-04-01 15:15:22');
INSERT INTO `books` (`id`, `title`, `author`, `description`, `cover_photo`, `viewed`, `download_url`, `created_by`, `deleted_at`, `created_at`, `updated_at`) VALUES
(4, 'Từ Tốt Đến Vĩ Đại', 'Jim Collins', 'Jim Collins - Tác giả của cuốn sách viết về giới kinh doanh Từ Tốt Đến Vĩ Đại vừa là người học và cũng vừa là người dạy tại các công ty vĩ đại và trường tồn. Trăn trở với câu hỏi lớn “Làm thế nào những công ty tốt, công ty bình thường, hay ngay cả công ty đang trong tình trạng tồi tệ cũng có thể đạt đến mức vĩ đại trường tồn?\" Nên ông và các đồng sự đã mất một khoảng thời gian khá dài để nghiên cứu và khám phá ra cách thức để các công ty này tăng trưởng, đạt thành tích cao, chuyển mình và nhảy vọt từ “tốt” đến “vĩ đại”. Một vấn đề mà ai cũng quan tâm, muốn tìm hiểu nhưng không phải ai cũng có được sự kiên nhẫn tìm đến tận cùng câu trả lời.\r\n\r\nCuối cùng quyển sách ra đời với 9 chương bố cục rõ ràng, rành mạch và kèm theo đó là các phụ lục được ghi chú cẩn thận, chi tiết. Cách trình bày sách logic rõ ràng cùng với những đồ thị, số liệu và biểu đồ được ghi chép rất tỉ mỉ, cẩn thận. Một sự nghiên cứu nghiêm túc và đã trải qua kiểm chứng cụ thể từ sự phát triển nhảy vọt từ mức “tốt” lên “vĩ đại” của 11 công ty. Do đó những thông tin đưa ra cực kì hữu ích và sao sát thực tế hơn bao giờ hết. Cách lồng ghép so sánh trong quyển sách cũng rất thú vị nhưng lại hiệu quả vô cùng như câu chuyện giữa nhím và cáo trong chương 5 cùng những thông điệp hữu ích “Hãy tự biết mình” và biết cách đưa những tình huống khó xử thành ý tưởng đơn giản nhất. Những điểm quan trọng nhất mà sách nhấn mạnh đó là: ý tưởng, chiến lược, kỷ luật, công nghệ và cuối cùng là cách xây dựng nền tảng để nhảy vọt. Mỗi kết luận này đều mang những ý nghĩa to lớn và hữu ích thậm chí có thể khiến độc giả ngạc nhiên nhưng khó có ai phủ nhận được giá trị cùng những triết lí mà quyển sách mang lại.\r\n\r\nQuả thật đây là một cuốn sách không thể thiếu cho những ai đang bước vào giới kinh doanh và đang điều hành những công ty lớn, nhỏ.\r\n\r\n©\r\n\r\nJim Collins cùng nhóm nghiên cứu đã miệt mài nghiên cứu những công ty có bước nhảy vọt và bền vững để rút ra những kết luận sát sườn, những yếu tố cần kíp để đưa công ty từ tốt đến vĩ đại. Đó là những yếu tố khả năng lãnh đạo, con người, văn hóa, kỷ luật, công nghệ… Những yếu tố này được nhóm nghiên cứu xem xét tỉ mỉ và kiểm chứng cụ thể qua 11 công ty nhảy vọt lên vĩ đại.\r\n\r\nMỗi kết luận của nhóm nghiên cứu đều hữu ích, vượt thời gian, ý nghĩa vô cùng to lớn đối với mọi lãnh đạo và quản lý ở mọi loại hình công ty (từ công ty có nền tảng và xuất phát tốt đến những công ty mới khởi nghiệp), và mọi lĩnh vực ngành nghề.', , 2, 'http://sachvui.com/download/epub/5255', 2, NULL, '2018-04-01 13:10:38', '2018-04-01 13:52:44');
INSERT INTO `books` (`id`, `title`, `author`, `description`, `cover_photo`, `viewed`, `download_url`, `created_by`, `deleted_at`, `created_at`, `updated_at`) VALUES
(5, 'Pr Là Sống', 'Phạm Quốc Hưng', 'PR là một chức năng quản trị định hướng thái độ của công chúng, xác định chính sách, thực hiện và làm cho quan tâm một tổ chức, được thực hiện theo một chương trình hành động tìm kiếm sự thông hiểu và chấp nhận của công chúng” theo lời một nữ chuyên gia PR định nghĩa. \r\n\r\nNgày nay trong bất cứ ngành nào, PR vẫn rất quan trọng. PR thể hiện tầm quan trọng trong giao tiếp của một tổ chức hay một cá nhân và đối tượng của họ như là nhân viên, đối tác, nhóm cần quan tâm. Đặc biệt, chúng ta có thể thấy sức mạnh của PR trong lĩnh vực dịch vụ như ngân hàng, tài chính, vận tải, du lịch, nhà hàng, khách sạn mà các hoạt động của con người cần sự giao tiếp tốt để có hiệu quả công việc cao. \r\n\r\nBằng tất cả nỗ lực, tác giả đã cố gắng thực hiện và hoàn thành cuốn sách này. Hy vọng tất cả trải nghiệm, suy nghĩ, ý tưởng và cảm nhận của tác giả có thể đóng góp một phần vào sự hoàn hảo của cộng đồng PR. PR không tự nó là phương thuốc diệu kỳ cho sự vững mạnh của thương hiệu mà ở tại người nhìn nhận và sử dụng nó như thế nào. Với các nguyên tắc 3PR, 3S, CAR, NCNS, và ANGEL STARS, PR sẽ thật sự sống mãi cùng thương hiệu của từng tổ chức và cuộc đời của mỗi người.', , 0, 'http://sachvui.com/download/epub/4665', 2, NULL, '2018-04-01 13:11:32', '2018-04-01 13:11:32');

